function searchMods() {
            var find, table, column, rows, cell, item;
            find = document.getElementById("search").value.toUpperCase();
            table = document.getElementById("mods");
            column = 0;
            rows = table.getElementsByTagName("tr");
            for (item = 0; item < rows.length; item++) {
                cell = rows[item].getElementsByTagName("td")[column];
                if (cell) {
                    if (cell.innerHTML.toUpperCase().indexOf(find) > -1) {
                        rows[item].style.display = ""
                    } else {
                        rows[item].style.display = "none"
                    }
                }
            }
        };

        function onLoad() {
            var md5 = location.search.split('md5=')[1];
            if (md5) {
                var find, table, column, rows, cell, item;
                find = md5.toUpperCase();
                table = document.getElementById("mods");
                column = 2;
                rows = table.getElementsByTagName("tr");
                for (item = 0; item < rows.length; item++) {
                    cell = rows[item].getElementsByTagName("td")[column];
                    if (cell) {
                        if (cell.innerHTML.toUpperCase().indexOf(find) > -1) {
                            rows[item].style.display = "";
                        } else {
                            rows[item].style.display = "none";
                        }
                    }
                }
            }
        };

